import React, {useState} from 'react';
import './css.css' //voiko käyttää
import Etusivu from './components/Etusivu';
import Harrastajat from './components/Harrastajat';
import Ammattilaiset from './components/Ammattilaiset';
import OmatTreenit from './components/OmatTreenit';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'; // font awesome ikonit käyttöön
import { faHome } from '@fortawesome/free-solid-svg-icons';
import {BrowserRouter as Router, Route} from 'react-router-dom'; //Applikaation sivujen reititys
import 'bootstrap/dist/css/bootstrap.min.css'; //Importataan bootstrapin tyylit
import Nav from 'react-bootstrap/Nav';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';



const App = () => {
  function MyVerticallyCenteredModal(props) {
    const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);
    return (
      <Modal
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Modal heading
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <h4>Centered Modal</h4>
          <p>
            Cras mattis consectetur purus sit amet fermentum. Cras justo odio,
            dapibus ac facilisis in, egestas eget quam. Morbi leo risus, porta ac
            consectetur ac, vestibulum at eros.
          </p>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={props.onHide}>Close</Button>
        </Modal.Footer>
      </Modal>
    );
  }
  const [modalShow, setModalShow] = React.useState(false);
  const element = <FontAwesomeIcon icon={faHome} size="2x" color="black" />
  return (
    <div>
      <h1>
          TREENIPÄIVÄKIRJA
        </h1>
        <h6>
          Harjoitus 4, created by Jenni Lehtonen
        </h6>

        <>
      <Button variant="primary" onClick={() => setModalShow(true)}>
        Launch vertically centered modal
      </Button>

      <MyVerticallyCenteredModal
        show={modalShow}
        onHide={() => setModalShow(false)}
      />
    </>

        <>
          <Nav className="justify-content-center">
            <Nav.Item>
              <Nav.Link href="/">{element} home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/harrastajat">Harrastajat</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/ammattilaiset">Ammattilaiset</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/Omattreenit">Omat treenit</Nav.Link>
            </Nav.Item>
          </Nav>
          
          <Router>
            <Route exact path="/" component={Etusivu} />
            <Route exact path="/harrastajat" component={Harrastajat} />
            <Route exact path="/ammattilaiset" component={Ammattilaiset} />
            <Route exact path="/omattreenit" component={OmatTreenit} />
          </Router>
        </>
      

    </div>
  );
}

export default App;
